window.bookSummaryJSON = "<p>After nearly eighteen months at Basgiath War College, Violet Sorrengail knows there’s no more time for lessons. No more time for uncertainty.<br> <br> Because the battle has truly begun, and with enemies closing in from outside their walls and within their ranks, it’s impossible to know who to trust.<br> <br> Now Violet must journey beyond the failing Aretian wards to seek allies from unfamiliar lands to stand with Navarre. The trip will test every bit of her wit, luck, and strength, but she will do anything to save what she loves—her dragons, her family, her home, and <i>him</i>.<br> <br> Even if it means keeping a secret so big, it could destroy everything.<br> <br> They need an army. They need power. They need <i>magic</i>. And they need the one thing only Violet can find—the truth.<br> <br> But a storm is coming...and not everyone can survive its wrath.<br> <br> The Empyrean series is best enjoyed in order.<br> Listening Order:<br> Book #1 Fourth Wing<br> Book #2 Iron Flame<br> Book #3 Onyx Storm</p>"; 
